import React from "react";
import "./App.css";
import img from "./Image/FH-logo.png";
import bannerimage from "./Image/image.png";

function App() {
  return (
    <div>
      <div className="logo">
        <img src={img} alt="" />
      </div>
      <div className="banner-img">
        <img src={bannerimage} alt="" />
      </div>
      <div className="banner-text">
        <h1>Social Media</h1>
        <h2>Marketing for Businesses</h2>
        <p>Social media marketing is a powerful way for businesses of all sizes to reach prospects and customers. People discover, learn about, follow, and shop from brands on social media, so if you’re not on platforms like Facebook, Instagram, and LinkedIn, you’re missing out! Great marketing on social media can bring remarkable success to your business, creating devoted brand advocates and even driving leads and sales.</p>
      <h3>WE BRING LIFE TO YOUR IDEAS AND DREAMS.</h3>
      </div>
    </div>
  );
}

export default App;
